    beforeEach(function() {
        module('ui.router');
        module('priceOptimizer');

        // Provide will help us create fake implementations for our dependencies
        module(function($provide) {

            // Fake PriceOptimizer Implementation
            $provide.value('PriceOptimizer', {});

            // Fake optimizerData Implementation
            $provide.value('optimizerData', {
                data: apiData
            });

            // Fake ngDialog Implementation
            $provide.value('ngDialog', {
                open: function () {
                    return true;
                }
            });

            // Fake hotelId Implementation
            $provide.value('hotelId', '1234');

            return null;
        });
    });

    beforeEach(function() {
        // When Angular Injects the UserProfile dependency,
        // it will use the implementation we provided above
        inject(function($controller, $rootScope, _$state_, _ngDialog_, _optimizerData_, _PriceOptimizer_, _hotelId_, $q) {
            $scope = $rootScope.$new();
            $state = _$state_;
            hotelId = _hotelId_;
            optimizerData = _optimizerData_;
            PriceOptimizer = _PriceOptimizer_;
            ctrl = $controller('Optimizer', {
                    $scope: $scope
                });

            PriceOptimizer.save = function (obj, hid) {
                var deferred = $q.defer();
                deferred.resolve(function() {
                    return obj;
                });
                return deferred.promise;
            };

            PriceOptimizer.publish = function (hid, month, year) {
                var deferred = $q.defer();
                deferred.resolve(function() {
                    return obj;
                });
                return deferred.promise;
            };
        });
    });

    describe('Card based calendar view', function () {
        it("should generate the cards for current month", function() {
            var monthSet = ctrl._generateMonthStrip(current.year, current.month);

            expect(monthSet.name).toEqual(genData.name);
            expect(monthSet.month).toEqual(genData.month);
            _.forEach(genData.dates, function (value, key) {
                _.forEach(genData.dates[key], function (value, day) {
                    expect(monthSet.dates[key][day]).toEqual(genData.dates[key][day]);
                });
            });
        });

        it('should hide the left navigation if current month', function () {
            expect(ctrl.isCurrentMonth).toBeTruthy();
            expect(ctrl.checkMonth(ctrl.firstMonth)).toBeTruthy();

            ctrl.firstMonth = parseInt(moment().add(1, 'month').format("M"));
            expect(ctrl.checkMonth(ctrl.firstMonth)).toBeFalsy();
        });

        it('should generate the cards for the next month on navigation to right', function () {
            ctrl.currentMonth = current.month;
            ctrl.currentYear = current.year;
            ctrl.nextMonth();

            expect(ctrl.monthSet.name).toEqual(nextGenData.name);
            expect(ctrl.monthSet.month).toEqual(nextGenData.month);
            _.forEach(nextGenData.dates, function (value, key) {
                _.forEach(nextGenData.dates[key], function (value, day) {
                    expect(ctrl.monthSet.dates[key][day]).toEqual(nextGenData.dates[key][day]);
                });
            });
        });

        it('should generate the cards for the previous month on navigation to left', function () {
            ctrl.currentMonth = current.month + 1;
            ctrl.currentYear = current.year;
            ctrl.prevMonth();

            expect(ctrl.monthSet.name).toEqual(genData.name);
            expect(ctrl.monthSet.month).toEqual(genData.month);
            _.forEach(genData.dates, function (value, key) {
                _.forEach(genData.dates[key], function (value, day) {
                    expect(ctrl.monthSet.dates[key][day]).toEqual(genData.dates[key][day]);
                });
            });
        });
    });

    describe('Editing single card', function () {

        it('should open the popup with the selected card, on click of edit', function () {
            var card = genData.dates[1][0];
            var card2 = genData.dates[1][1];
            expect($scope.day).not.toEqual(card);

            $scope.open(card);
            expect($scope.day).toEqual(card);

            $scope.open(card2);
            expect($scope.day).toEqual(card2);
        });

        it('should initialize the input fields based on recommendations and overrides', function () {
            var day = genData.dates[1][1];
            var room = genData.dates[1][0].rooms[1];
            expect(room.inputPrice).toBeUndefined();
            expect(day.recommendation).toBeTruthy();
            ctrl.initInput(room, day);

            expect(room.reset).toBeFalsy();
            expect(room.inputPrice).toEqual(room.recPrice);
        });

        it('should allow to override the recommended prices and save', function () {
            var day = genData.dates[1][1];
            var room = day.rooms[2];
            expect(day.recommendation).toBeTruthy();
            expect(room.inputPrice).toBeUndefined();
            expect(room.overidden).toBeUndefined();
            ctrl.initInput(room, day);

            expect(room.inputPrice).toEqual(room.recPrice);
            expect(room.overidden).toEqual(room.inputPrice);
            room.overidden = 5800;

            ctrl.save(room, hotelId);
            expect(room.overidden).toEqual(5800);
        });

        it('should allow to reset overridden prices', function () {
            var room_before_init = {
                "override_price": null,
                "currentPrice": 5000,
                "room_id": 4,
                "code": "Suite",
                "applied_rule": "July",
                "variance": 1000,
                "recPrice": 6000,
                "override": false
            };

            var room_after_init = {
                "override_price": null,
                "currentPrice": 5000,
                "room_id": 4,
                "code": "Suite",
                "applied_rule": "July",
                "variance": 1000,
                "recPrice": 6000,
                "override": false,
                "reset": false,
                "inputPrice": 6000,
                "overidden": 6000
            };

            var overridden_room_before_reset = {
                "override_price": 7000,
                "currentPrice": 5000,
                "room_id": 4,
                "code": "Suite",
                "applied_rule": "July",
                "variance": 1000,
                "recPrice": 6000,
                "override": true,
                "reset": false,
                "inputPrice": 6000,
                "overidden": 6000
            };

            var overridden_room_after_reset = {
                "override_price": 7000,
                "currentPrice": 5000,
                "room_id": 4,
                "code": "Suite",
                "applied_rule": "July",
                "variance": 1000,
                "recPrice": 6000,
                "override": true,
                "reset": false,
                "inputPrice": 6000,
                "overidden": 6000
            };

            var day = genData.dates[1][1];
            var room = day.rooms[3];
            expect(room).toEqual(room_before_init);

            ctrl.initInput(room, day);
            expect(room).not.toEqual(room_before_init);
            expect(room).toEqual(room_after_init);

            expect(overridden_room_after_reset).toEqual(overridden_room_before_reset);

            ctrl.reset(overridden_room_after_reset);
            expect(overridden_room_after_reset).not.toEqual(overridden_room_before_reset);
        });

        it('should publish the rates to channel manager', function () {
            expect($scope.publishing).toBeFalsy();

            ctrl.publishData(hotelId, current.month, current.year);
            expect($scope.publishing).toBeTruthy();
        });
    });
